import React, { useState, useEffect } from "react";
import "./App.css";
import Navbar from "./components/navbar/Navbar";
import Button from "./components/button/Button";
import Card from "./components/card/Card";
import Compu from "./assets/img/compu.png";
import Star from "./assets/img/star.svg";
import Rulo from "./assets/img/rulo.svg";
import Trabajo1 from "./assets/img/trabajos/trabajo5.jpg";
import Trabajo2 from "./assets/img/trabajos/trabajo2.jpg";
import Trabajo3 from "./assets/img/trabajos/trabajo3.jpg";
import Trabajo4 from "./assets/img/trabajos/trabajo4.jpg";
import Footer from "./components/footer/Footer";
import Contacto from "./Contacto";

function App() {
  const [route, setRoute] = useState(window.location.hash || "");

  useEffect(() => {
    function onHash() {
      setRoute(window.location.hash || "");
    }
    window.addEventListener("hashchange", onHash);
    return () => window.removeEventListener("hashchange", onHash);
  }, []);
  const cardItems = [
    { image: Trabajo1, title: "Rediseño tienda online", text: "E-commerce rebranding y optimización" },
    { image: Trabajo2, title: "Diseño de app mobile", text: "Diseño de experiencia de usuario e interfaz" },
    { image: Trabajo3, title: "Identidad visual", text: "Logotipo y sistema de marca para web" },
    { image: Trabajo4, title: "Landing conversion", text: "Diseño de sitio web orientado a conversión" },
  ];

  return (
    <div className="App">
      <header>
        <Navbar />
      </header>
      <main>
        <div
          id="home"
          className="home d-flex justify-conten-space-between align-items-center"
        >
          <div className="main-title">
            <h1>
              El impulso
              <br />
              que hace crecer
              <br />
              tu marca
            </h1>

            <Button texto="Hablemos!" variant="primario" onClick={() => (window.location.hash = "#contacto")} />
          </div>
          <div>
            <img
              src={Compu}
              alt="Una mano sosteniendo un megáfono sale desde la pantalla de una computadora portátil, con un fondo de líneas onduladas en tonos azul y turquesa"
            />
          </div>
        </div>

        {route === "#contacto" ? (
          <Contacto />
        ) : (
        <div className="conocenos" id="conocenos">
          <div className="conocenos-row">
            <div className="conocenos-title">
              <h2>Conocenos !</h2>
            </div>
            <div className="conocenos-image">
              <img src={Star} alt="Descripción de la imagen" />
            </div>
          </div>
          <div className="conocenos-row conocenos-text-row">
            <div>
              <p>
                En nuestra agencia creemos que cada emprendimiento tiene una
                historia única y un potencial enorme por desarrollar. Por eso
                trabajamos para acompañarte en cada etapa, transformando tus
                ideas en estrategias claras, medibles y efectivas.
              </p>
            </div>
            <div>
              <p>
                Nos comprometemos con un estilo de trabajo transparente, cercano
                y accesible, pensado especialmente para emprendedores que
                necesitan soluciones profesionales sin perder simplicidad y
                claridad. Si estás listo para dar el próximo paso con tu marca,
                estamos acá para hacerlo juntos.
              </p>
            </div>
          </div>
        </div>
        )}

        <div className="trabajos" id="trabajos">
         <div className="conocenos-row">
            <div className="conocenos-image">
              <img src={Rulo} alt="Descripción de la imagen" />
            </div>
            <div className="conocenos-title">
              <h2>Nuestros trabajos</h2>
            </div>
          </div>
          <div className="cards-container">
            {cardItems.map((item, idx) => (
              <Card
                key={idx}
                image={item.image}
                title={item.title}
                text={item.text}
              />
            ))}
          </div>
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default App;
